import React, { Component } from 'react';
import './App.scss';


class App extends Component {
  render() {
    return (
      <div className="App">
        <body class="container">

          <div class="navigation">
            <button class="btn">Hello</button>
          </div>
          <div class="random">Random Word</div>

        </body>
      </div>
    );
  }
}


export default App;
